                    </form>
                    <div>
                        <Link to="/Quiz" target='_blank' className='btn btn-lg btn-outline-dark me-3' id='quizBtn'>Take a Quiz</Link>
                        <Link to="/LoginSignup" className='btn btn-lg btn-outline-dark me-3' id='loginBtn'>{
                            
                        }
                        </Link>
                        
                    </div>                 
                </div>
             </nav>
        </div>
  );
}

export default Navbar;
